import styled from 'styled-components/macro';

function Posts(props) {
    let postStyle = {
      border: '1px solid',
      padding: '0.5em',
      cursor: 'pointer'
    }
    return <ul>
      {props.posts.map(post => {
        return <div style={postStyle} key={post.id}>
          {post.title} ({post.id})
        </div>
      })}
    </ul>
  }
